import React from 'react'


const Personajes = ({personaje = []}) =>{

    return(

    <div >
                  { personaje.map(pers => { 
                      return 
                      <div key={pers.id} className='col'>
                               <div className='card'>
                                <img src={pers.image} alt="" />   
                                </div>
                     </div>
                  })
                  }
    </div>
)
}

export default Personajes
